import React, { useEffect, useState, useContext } from "react";
import { IStudentHomework } from "../domain/IStudentHomework";
import { IStudentSubject } from "../domain/IStudentSubjectDTO";
import { AppContext } from "../context/AppContext";
import { BaseService } from "../base/BaseService";

interface IState {
    studentSubjects: IStudentSubject[];
}

const HomeLogged = () => {
    const [subjects, setSubjects] = useState({ studentSubjects: [] } as IState);
    const appContext = useContext(AppContext);
    const data = async () => await BaseService
        .getSingle<IStudentSubject[]>('studentHomework/HomeIndex/homepage', appContext.jwt!)
        .then(data => setSubjects({ ...subjects, studentSubjects: data! }));

    useEffect(() => {
        data();
    }, []);

    return (
        <div>
            <h1 className="text-center">Welcome</h1>
        </div>);
};

export default HomeLogged;
